import React, { Component } from 'react';
class LeadMal extends Component{

    render(){
        var { lead } = this.props;
        if (lead.EstadoGeneral === 0){
            
        return(
                <div className="card-header d-flex justify-content-around col-12 m-auto tablasdeleads text-center" key={lead.id}>
                <p className="col-xl-2 mb-0 d-flex flex-column"> Nombre  <span> {lead.Nombre}</span></p>
                <p className="col-xl-1 mb-0 d-flex flex-column"> Ubicación  <span> {lead.Ubicacion}</span></p>
                <p className="col-xl-2 mb-0 d-flex flex-column"> Campaña  <span> {lead.CampaingID}</span></p>
                <p className="col-xl-1 mb-0 d-flex flex-column"> Fecha   <span> {lead.CreateDate}</span></p>
                <p className="col-xl-1 mb-0 d-flex flex-column "> DPI <span> {lead.DPI}</span></p>
                <p className="col-xl-2 mb-0 d-flex flex-column "> Email <span> {lead.Email} </span></p>
                <p className="col-xl-1 mb-0 d-flex flex-column "> Plataforma <span> {lead.Plataforma}  </span> </p>
                <p className="col-xl-1 mb-0 d-flex flex-column "> Teléfono <span> {lead.Telefono} </span> </p>
            </div>  
            
        )
        
    }else{
        return null;
    }
    }
}
export default LeadMal;
